class C12_Page_Header extends \Elementor\Widget_Base {

    public function get_name() {
        return 'c12_page_header';
    }

    public function get_title() {
        return esc_html__('Page Header', 'c12-elementor-plugin');
    }

    public function get_icon() {
        return 'eicon-progress-tracker';
    }

    public function get_categories() {
        return ['c12-widgets'];
        // return ['basic'];
    }

    public function get_keywords() {
        return ['page', 'header'];
    }

    public function get_style_depends() {
        return ['c12-widget-styles'];
    }

    protected function register_controls() {
        // Content Tab Start
        $this->start_controls_section(
            'section_title_content',
            [
                'label' => esc_html__('Page Header Content', 'c12-elementor-plugin'),
                'tab'   => \Elementor\Controls_Manager::TAB_CONTENT,
            ]
        );

        $this->add_control(
            'Background',
            [
				'label' => esc_html__( 'Border Style', 'c12-elementor-plugin' ),
				'type' => \Elementor\Controls_Manager::SELECT,
				'default' => 'burst',
