					'' => esc_html__( 'Default', 'c12-elementor-plugin' ),
					'burst' => esc_html__( 'burst', 'c12-elementor-plugin' ),
					'houses'  => esc_html__( 'houses', 'c12-elementor-plugin' ),
					'heart' => esc_html__( 'heart', 'c12-elementor-pluginn' ),
