					'news' => esc_html__( 'news', 'c12-elementor-plugin' ),
					'contact' => esc_html__( 'contact', 'c12-elementor-plugin' ),
				],
			]
        );

        $this->end_controls_section();

        // Style Tab Start
        $this->start_controls_section(
            'section_title_style',
            [
                'label' => esc_html__('Page Header Styles', 'c12-elementor-plugin'),
                'tab'   => \Elementor\Controls_Manager::TAB_STYLE,
            ]
        );

        $this->add_control(
            'title_color',
            [
                'label' => esc_html__('Text Color', 'c12-elementor-plugin'),
                'type'  => \Elementor\Controls_Manager::COLOR,
                'selectors' => [
                    '{{WRAPPER}} .c12-page-header h1' => 'color: {{VALUE}};',
                ]
            ]
        );

        
        

        $this->add_control(
            'shape_color',
            [
                'default' => 'var(--e-global-color-290b0ef)',
                'label' => esc_html__('Shape Color', 'c12-elementor-plugin'),
                'type'  => \Elementor\Controls_Manager::COLOR,
                'selectors' => [
                    '{{WRAPPER}} .c12-page-header svg rect' => 'fill: {{VALUE}};',
                    '{{WRAPPER}} .c12-page-header svg path' => 'fill: {{VALUE}};',
                    '{{WRAPPER}} .c12-page-header svg circle' => 'fill: {{VALUE}};',
                ]
            ]
        );

       

        $this->end_controls_section();
    }

